import React from 'react';
import data from './data/scores.json'

function JsonProcessor() {
  fetch('./scores.json')
  .then((res) => res.json())
  .then((data) => {
    console.log('data: ', data);
  })
  return (
    <div>...</div>
  );
}


export default JsonProcessor;
